import React from 'react'
import CrewCard from './CrewCard'

export default function CrewSection(props) {
  return (
    <>
    
    <div>
    <p className='mb-3 text-center sm:text-left'>Yönetmen</p>
    <CrewCard data={props.data?.director[0]}/>
    </div>

    <div>
    {(props.data?.screenplay[0]) ? <p className='mb-3 text-center m:text-left'>Senarist</p> : ''}
    {props.data?.screenplay.slice(0, 2).map(item =>
    <>
    <CrewCard data={item}/>
    </>
    )}
    </div>

    <div>
    {(props.data?.writer[0]) ? <p className='mb-3 text-center sm:text-left'>Yazar</p> : ''}
    {props.data?.writer.slice(0, 2).map(item =>
    <CrewCard data={item}/>
    )}    
    </div>

    </>
  )
}
